import React, { Component } from 'react';
import PDFViewer from './PDFViewer';
import PDFJs from './backend/pdf_puller.js';

export default  class Resume extends Component {

  render() {

    return (
      <div>
        <PDFViewer 
          backend={PDFJSBackend}
          src='/myPDF.pdf'
        />
      </div>
    );
  }
}
